&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Con Mis primeros veh&iacute;culos LEGO&reg; DUPLO&reg;, los m&aacute;s peque&ntilde;os aprender&aacute;n a combinar bases con ruedas y ladrillos de colores para crear veh&iacute;culos con todas las formas y de todos los tama&ntilde;os. Este imaginativo set proporciona infinitas oportunidades de desarrollar la creatividad y las habilidades de narraci&oacute;n, y cuenta con ladrillos decorados y tarjetas de construcci&oacute;n para dar lugar a nuevas ideas. Los grandes ladrillos DUPLO est&aacute;n dise&ntilde;ados especialmente para proporcionar seguridad y resultar adecuados en las manos de los m&aacute;s peque&ntilde;os.&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Tema: Duplo&lt;/li&gt;
&lt;li&gt;Cuenta con 3 bases con ruedas, una gr&uacute;a y ladrillos LEGO&reg; DUPLO&reg; decorados con motivos automovil&iacute;sticos para combinar y crear.&lt;/li&gt;
&lt;li&gt;Incluye ladrillos decorados con diferentes ventanillas, conductores y pasajeros, una estaci&oacute;n de repostaje de agua y un ladrillo decorado a doble cara como sem&aacute;foro para estimular el juego de interpretaci&oacute;n.&lt;/li&gt;
&lt;li&gt;Ayuda a tu hijo a usar la tarjeta de construcci&oacute;n para crear nuevos veh&iacute;culos por s&iacute; solo.&lt;/li&gt;
&lt;li&gt;Fomenta la construcci&oacute;n y el juego de interpretaci&oacute;n a trav&eacute;s del tema de la conducci&oacute;n.&lt;/li&gt;
&lt;li&gt;Los productos LEGO&reg; DUPLO&reg; se dise&ntilde;an espec&iacute;ficamente para ser divertidos y f&aacute;ciles de usar en las manos de los m&aacute;s peque&ntilde;os.&lt;/li&gt;
&lt;li&gt;El coche mide m&aacute;s de 6 cm de altura, 9 cm de longitud y 5 cm de ancho.&lt;/li&gt;
&lt;li&gt;El cami&oacute;n de bomberos mide m&aacute;s de 13 cm de altura, 9 cm de longitud y 5 cm de ancho.&lt;/li&gt;
&lt;li&gt;El cami&oacute;n de mercanc&iacute;as mide m&aacute;s de 9 cm de altura, 10 cm de longitud y 6 cm de ancho.&nbsp;&lt;/li&gt;
&lt;li&gt;La gr&uacute;a mide m&aacute;s de 12 cm de altura, 8 cm de longitud y 3 cm de ancho.&lt;/li&gt;
&lt;li&gt;Edad: 1&frac12; - 5&lt;/li&gt;
&lt;li&gt;Piezas: 36&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;T&eacute;rminos y condiciones:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;* Tienda Oficial de LEGO&reg;.&lt;/p&gt;
&lt;p&gt;* Garant&iacute;a: Sujetas a la marca.&lt;/p&gt;
&lt;p&gt;* Tiempo de entrega: De 6 a 10 d&iacute;as habiles a partir de la aprobaci&oacute;n del pago.&lt;/p&gt;
&lt;p&gt;* Valido hasta agotar existencias.&lt;/p&gt;
&lt;p&gt;* Unidades limitadas.&lt;/p&gt;
&lt;p&gt;* Precios sujetos a cambios sin previo aviso.&lt;/p&gt;

